import React, { Component } from 'react';
import { render } from "react-dom";
import { Chrono } from "react-chrono";
import { ThemeConsumer } from 'styled-components';

const items = [
    {
        title: "May 1940",
        cardTitle: "Dunkirk",
        cardSubtitle:
          "Men of the British Expeditionary Force (BEF) wade out to a destroyer during the evacuation from Dunkirk.",
        cardDetailedText: ["AfterClass Intern", "paragraph2"],
      },
      {
        title: "May 1940",
        cardTitle: "Dunkirk",
        cardSubtitle:
          "Men of the British Expeditionary Force (BEF) wade out to a destroyer during the evacuation from Dunkirk.",
        cardDetailedText: ["BIA Data Associate Programme", "paragraph2"],
      },
      {
        title: "May 1940",
        cardTitle: "Dunkirk",
        cardSubtitle:
          "Men of the British Expeditionary Force (BEF) wade out to a destroyer during the evacuation from Dunkirk.",
        cardDetailedText: ["Ellipsis Marketing", "paragraph2"],
      },
];

class NewTimeline extends Component {
    render() {
        return (
            <div style={{ width: "100%", height: "100%" }}>
            <Chrono
              items={items}
              mode="VERTICAL_ALTERNATING"
              hideControls="true"
              theme={{primary: "#cdcdcd", secondary: "white", cardBgColor: "#00011c", cardForeColor: "#cdcdcd" }} 
              />

          </div>
        );
    }
}

export default NewTimeline;
